import React, { useState, useEffect } from 'react';
import useAxiosPrivate from '../hooks/useAxiosPrivate';
import { IconButton, Dialog, DialogTitle, DialogContent, DialogActions, Button } from '@mui/material';
import { Edit, Delete } from '@mui/icons-material';

const UserTable = () => {
    const [users, setUsers] = useState([]);
    const [searchUsername, setSearchUsername] = useState('');
    const axiosPrivate = useAxiosPrivate();

    useEffect(() => {
        fetchUsers();
    }, [searchUsername]);

    const fetchUsers = async () => {
        try {
            const endpoint = searchUsername ? '/user' : '/allUsers';
            const params = searchUsername ? { username: searchUsername } : {};

            const response = await axiosPrivate.get(endpoint, { params });
            setUsers(response.data);
        } catch (error) {
            console.error('Error fetching users:', error);
        }
    };

    const handleSearch = (e) => {
        setSearchUsername(e.target.value);
    };

    const clearSearch = () => {
        setSearchUsername('');
    };

    const [selectedUserId, setSelectedUserId] = useState(null);
    const [openDialog, setOpenDialog] = useState(false);
    const [selectedRole, setSelectedRole] = useState('');

    // Function to handle role change icon click
    const handleRoleChangeClick = (userId) => {
        setSelectedUserId(userId);
        setOpenDialog(true);
    };

    // Function to handle delete icon click
    const handleDeleteClick = (userId) => {
        const confirmed = window.confirm('Are you sure you want to delete this user?');
        if (confirmed) {
            // Call the deleteUser method on the backend if confirmed
            deleteUser(userId);
        }
    };

    // Function to perform the role change action
    const handleRoleChange = async () => {
        try {
            const response = await axiosPrivate.post(`/rolechange?roleName=${selectedRole}&userId=${selectedUserId}`);
            setOpenDialog(false); // Close the dialog after role change
        } catch (error) {
            console.error('Error changing user role:', error);
            // Handle any error, if needed
        }
    };

    // Function to delete the user
    const deleteUser = async (userId) => {
        try {
            const response = await axiosPrivate.post(`/deleteUser?userId=${userId}`);
            fetchUsers(); // Fetch users again after deletion to update the table
        } catch (error) {
            console.error('Error deleting user:', error);
            // Handle any error, if needed
        }
    };

    return (
        <div>
            <h2>User Table</h2>
            <div>
                <input
                    type="text"
                    value={searchUsername}
                    onChange={handleSearch}
                    placeholder="Search by username"
                />
                <button onClick={clearSearch}>Clear Search</button>
            </div>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Username</th>
                        <th>Role</th>
                        <th>Actions</th> {/* Add a new column for actions */}
                    </tr>
                </thead>
                <tbody>
                    {users.map((user) => (
                        <tr key={user.id}>
                            <td>{user.id}</td>
                            <td>{user.username}</td>
                            <td>{user.roles[0].name}</td>
                            <td>
                                {/* Icons for role change and delete */}
                                <IconButton onClick={() => handleRoleChangeClick(user.id)}>
                                    <Edit />
                                </IconButton>
                                <IconButton onClick={() => handleDeleteClick(user.id)}>
                                    <Delete />
                                </IconButton>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
            <Dialog open={openDialog} onClose={() => setOpenDialog(false)}>
                <DialogTitle>Select Role</DialogTitle>
                <DialogContent>
                    {/* Add a selection list or dropdown for roles */}
                    {/* For example, using a select input */}
                    <select value={selectedRole} onChange={(e) => setSelectedRole(e.target.value)}>
                        <option value="ADMIN">ADMIN</option>
                        <option value="USER">USER</option>
                    </select>
                </DialogContent>
                <DialogActions>
                    <Button onClick={() => setOpenDialog(false)}>Cancel</Button>
                    <Button onClick={handleRoleChange} color="primary">Save</Button>
                </DialogActions>
            </Dialog>
        </div>
    );
};

export default UserTable;
